import './Doctor.css';
import React from 'react';
export default function Doctor(){
    return(
        <div className='container'>
    {Players.map((player)=>(
   <div className='column'>
   <div className='card'>
   <img src={player.img} />
     <h3> {player.name} </h3>
     <p className='title'> {player.club} </p>
     <p><button className='btn'>Detail</button></p>
   </div>
 </div>  
    ))}
</div>
    );
}
